/** @format */

import React from "react";
import { Link } from "react-router-dom";
import classes from './MainNav.module.css';




function MainNav() {
	return (
		<header>
			<div className={classes.logo}><img className={classes.img} src="https://cdn.discordapp.com/attachments/862694659306029118/880950104960430111/Screen_Shot_2021-08-27_at_4.59.06_PM.png" alt="logo" /></div>
			<nav>
				<ul>
					<li>
					 <Link to="/"className ={classes.home} >< i className="material-icons"> castle </i>Home</Link>
					</li>
                    <li>
						<Link to="/trips"><i class="material-icons"> auto_awesome </i>Trips</Link>
					</li>
                    <li>
						<Link to="/account"><i class="material-icons"> celebration </i>Account</Link>
					</li>
                    <li>
						<Link to="/report-bug">Report Bug</Link>
					</li>
                    <li>
						<Link to="/sign-in">Sign-In</Link>
					</li>
				</ul>
			</nav>
		</header>
	);
}
export default MainNav;
